import React, { useState } from 'react';

const Task = () => {
  const [text, setText] = useState('');

  const handleChange = event => {
    setText(event.target.value);
  };

  return (
    <div>
      <input
        type="text"
        placeholder="Enter text"
        onChange={handleChange}
      />
      <p id="paragraph">
        {text}
      </p>
    </div>
  );
};

export default Task;
